import React from "react";
import "./App.css";
import Landing_page from "./screens/landing_page/Landing_page";
import Footer from "./screens/landing_page/footer/Footer";
import Navbar from "./screens/landing_page/navbar/Navbar";

import {BrowserRouter, Route, Switch ,R} from "react-router-dom";
import Timeline from "./screens/timeline/Timeline";
class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <Navbar />

        <Switch>
        <Route path="/timeline" component={Timeline} />
          <Route exact path="/" component={Landing_page} />
        </Switch>
        <Footer />
      </BrowserRouter>
    );
  }
}
export default App;
